--
-- Name: update_meal_learning_data(); Type: FUNCTION; Schema: public; Owner: neondb_owner
--

CREATE FUNCTION public.update_meal_learning_data() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    family_id_var INTEGER;
    dish_name_var VARCHAR(255);
    ingredients_var JSONB;
BEGIN
    -- Get meal plan item details
    SELECT mp.family_id, mpi.dish_name, mpi.ingredients
    INTO family_id_var, dish_name_var, ingredients_var
    FROM meal_plan_items mpi
    JOIN meal_plans mp ON mpi.meal_plan_id = mp.id
    WHERE mpi.id = COALESCE(NEW.meal_plan_item_id, OLD.meal_plan_item_id);

    -- Insert or update learning data
    INSERT INTO meal_learning_data (family_id, dish_name, ingredients, avg_rating, feedback_count, never_suggest_count)
    VALUES (family_id_var, dish_name_var, ingredients_var, 0.0, 0, 0)
    ON CONFLICT (family_id, dish_name) DO NOTHING;

    -- Recalculate aggregated data for this dish
    UPDATE meal_learning_data 
    SET 
        avg_rating = (
            SELECT COALESCE(AVG(mf.rating), 0.0)
            FROM meal_feedback mf
            JOIN meal_plan_items mpi ON mf.meal_plan_item_id = mpi.id
            JOIN meal_plans mp ON mpi.meal_plan_id = mp.id
            WHERE mp.family_id = family_id_var 
            AND mpi.dish_name = dish_name_var
            AND mf.feedback_type = 'rating'
            AND mf.rating IS NOT NULL
        ),
        feedback_count = (
            SELECT COUNT(*)
            FROM meal_feedback mf
            JOIN meal_plan_items mpi ON mf.meal_plan_item_id = mpi.id
            JOIN meal_plans mp ON mpi.meal_plan_id = mp.id
            WHERE mp.family_id = family_id_var 
            AND mpi.dish_name = dish_name_var
            AND mf.feedback_type = 'rating'
        ),
        never_suggest_count = (
            SELECT COUNT(*)
            FROM meal_feedback mf
            JOIN meal_plan_items mpi ON mf.meal_plan_item_id = mpi.id
            JOIN meal_plans mp ON mpi.meal_plan_id = mp.id
            WHERE mp.family_id = family_id_var 
            AND mpi.dish_name = dish_name_var
            AND mf.feedback_type = 'never_again'
            AND mf.never_suggest_again = TRUE
        ),
        updated_at = CURRENT_TIMESTAMP
    WHERE family_id = family_id_var AND dish_name = dish_name_var;

    RETURN COALESCE(NEW, OLD);
END;
$$;


