34	246	{"difficulty": "Middels", "instructions": "1. Forbered grønnsakene: Vask hodesalaten grundig og skjær den i tynne strimler. Vask agurken og skjær den i små terninger eller tynne staver. Sett til side.\\n2. Forbered laksen: Del laksefileten i fire like store porsjoner, eller i mindre biter om ønskelig. Tørk laksen lett med kjøkkenpapir og krydre den jevnt med røkt paprikapulver, salt og nykvernet pepper på begge sider.\\n3. Stek laksen: Varm olivenoljen i en stekepanne over middels høy varme. Legg laksestykkene forsiktig i pannen og stek i 3-4 minutter på hver side, eller til laksen er gjennomstekt og lett flaker seg når du presser på den. Ta laksen ut av pannen og la den hvile et par minutter. Del den eventuelt opp i mindre biter med en gaffel.\\n4. Varm tortillaene: Varm tortillaene i en tørr stekepanne i ca. 15-20 sekunder på hver side, til de er myke og smidige. Alternativt kan du pakke dem inn i folie og varme dem i ovnen på 180°C i 5-7 minutter.\\n5. Sett sammen tacoene: Fordel den stekte laksen på de varme tortillaene. Topp med rikelig med strimlet hodesalat og agurk.\\n6. Server: Avslutt med et par skjeer taco-saus på hver taco. Rull sammen eller brett og server umiddelbart."}	2025-10-03 18:44:39.417286+00
